var modelId=modelId;$(function(){loadGroup();if(modelId==""){setSortValue()}});function loadGroup(){$("#_parentId").combobox({url:ctxAdmin+"/sys/dictionary/groupCombobox?selectType=select",multiple:false,editable:false,onHidePanel:function(){if($("#id").val()!=undefined&&$(this).combobox("getValue")==$("#id").val()){$(this).combobox("setValue","")}}})}function setSortValue(){$.get(ctxAdmin+"/sys/dictionary/maxSort",function(a){if(a.code==1){$("#dictionary_orderNo").numberspinner("setValue",a.obj+30)}},"json")};